import React from 'react';
import {Link} from 'react-router-dom';
import {useEffect, useState} from 'react'
import axios from 'axios';

const baseUrl='http://127.0.0.1:8000/api/teacher/';

function TeacherRegister(){
    const [teacherData, setTeacherData]=useState({
        'full_name':'',
        'email':'',
        'passowrd':'',
        'qualificaiton':'',
        'mobile_no':'',
        'skills':'',
        'status':''
    });
    // Change Element Value
    const handleChange=(event)=>{
        setTeacherData({
            ...teacherData,
            [event.target.name]:event.target.value
        });
    }
    console.log(teacherData);
    //End
    //Submit Form
    const submitForm=()=>{
        const teacherFormData=new FormData();
        teacherFormData.append('full_name', teacherData.full_name)
        teacherFormData.append('email', teacherData.email)
        teacherFormData.append('password', teacherData.passowrd)
        teacherFormData.append('qualification', teacherData.qualificaiton)
        teacherFormData.append('mobile_no', teacherData.mobile_no)
        teacherFormData.append('skills', teacherData.skills)

        axios.post(baseUrl, teacherFormData).then()
    };
    //End
    return(
        <div className='container mt-4'>
            <div className='row'>
                <div className='col-6 offset-3'>
                    <div className='card'>
                        <h5 className='card-header'>Trainer Register</h5>
                        <div className='card-body'>
                            <form>
                                <div className='mb-3'>
                                    <label for="exampleInputEmail1" className='form-label'>Full Name</label>
                                    <input onChange={handleChange} type='text' name='full_name' className='form-control' />
                                </div>
                                <div className='mb-3'>
                                    <label for="exampleInputEmail1" className='form-label'>Email</label>
                                    <input onChange={handleChange} type='email' name="email" className='form-control' />
                                </div>
                                <div className='mb-3'>
                                    <label for="exampleInputEmail1" className='form-label'>Password</label>
                                    <input onChange={handleChange}  type='password' name="password" className='form-control' id='exampleInputPassword1' />
                                </div>
                                <div className='mb-3'>
                                    <label for="exampleInputEmail1" className='form-label'>Phone Number</label>
                                    <input onChange={handleChange} type='number'name="mobile_no" className='form-control' />
                                </div>
                                <div className='mb-3'>
                                    <label for="exampleInputEmail1" className='form-label'>Qualifications</label>
                                    <input  onChange={handleChange}type='text' name="qualification" className='form-control' />
                                </div>

                                <div className='mb-3'>
                                    <label for="exampleInputEmail1" className='form-label'>Skills</label>
                                    <textarea onChange={handleChange} name="skills" className='form-control'></textarea>
                                    <div className='form-yext' id='emailHelp'>PHP, Python, JS, etc.</div>
                                </div>
                                <button onClick={submitForm} type='submit' className='btn btn-primary'>Register</button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default TeacherRegister;
